import React, { useState } from "react";
import '../css/home.css';

function Home() {



    return (
        <>
            <div className="home-wrapper">

                {/* MAIN DESCRIPTION */}
                <h1>SICK OF PARKING?</h1>
                <h2>We're sick of it too.</h2>
                <div className="description-home"><p>That's why we, in collaboration with VicRoads, are planning new parking developments in and around Melbourne's CBD. <br />
                We're here for helping Melbournians have easy access to parking, <br />making transportation easier for those not close to public transport. < br/>
                The best thing yet, is that with our proposed plan, parking violations will fall in and around these development areas.<br />
                How good is that?</p>
                </div>
                <div className="description-home"><p>That's why we, in collaboration with VicRoads, are planning new parking developments in and around Melbourne's CBD. <br />
                We're here for helping Melbournians have easy access to parking, making transportation easier for those not close to public transport. < br/>
                The best thing yet, is that with our proposed plan, parking violations will fall in and around these development areas.<br />
                How good is that?</p>
                </div>
            </div>
        </>
    )
}

export default Home;
